          <Login />
        </Route>
        <Route path="/add">
          <Protected />
          {/*<AddProducts />*/}
        </Route>
        <Route path="/update">
          <Protected />
          {/*<UpdateProducts />*/}
        </Route>
      </BrowserRouter>
    </div>
  );
}

export default App;
